import {
  withNavigationContext,
  Link
} from "react-awesome-slider/dist/navigation";

const Nav = withNavigationContext(({ fullpage }) => {
  const { slug } = fullpage.navigation;

  return (
    <header className="page-header" id="slide-navigator">
      <div className="page-header__wrapper">
        <nav>
          <Link className={slug === ""} href="/">
            index
          </Link>
          <Link className={slug === "page-two"} href="/page-two">
            page-two
          </Link>
        </nav>
      </div>
    </header>
  );
});

export default Nav;
